    .bg_mask {

            opacity: 1
        }
    }

    .logo {

    .pl__content {
        vertical-align: top;
        position: fixed;
        bottom: 5%;
        left: 0;
        right: 0;
        margin: auto;
        padding: 0;
        width: 97%;
        max-width: 400px;
        font-size: 13px;
        border-radius: 20px;
        white-space: normal;
        color: #000;
        text-align: center;
        box-shadow: 0 0 5px 0px #0000005c;
        cursor: pointer;
        background: linear-gradient(27deg, rgba(29, 36, 36, 1) 0%, rgba(72, 77, 87, 1) 100%);
        z-index: 10
    }

    .pl__message_content {
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: space-between
    }

    .pl__content .pl__message {
        padding: 5px 16px 20px 16px;
        line-height: 17px;
        display: -webkit-flex;
        display: -ms-flex;
        display: flex
    }

    .pl__right img {
        width: 9px
    }

    .pl__header__content {
        padding: 12px 15px 15px 15px;
        color: rgb(109, 107, 107);
        padding-bottom: 10px;
        box-sizing: border-box;
        display: flex;
        align-items: center;
        justify-content: space-between
    }

    .pl__left {
        display: flex;
        align-items: center;
        margin-right: 15px;
        position: relative
    }

    .pl__name__abonem {
        font-size: 16px;
        color: #ffffff;
        margin: 0
    }

    .pl__message {
        text-align: left
    }

    .pl__title {
        text-transform: uppercase;
        font-size: 15px;
        line-height: 17px;
        color: #a2a6a9;
        margin-left: 7px
    }

    .pl__right {
        display: flex;
        align-items: center;
        justify-content: center;
        padding: 5px;
        position: absolute;
        right: 8px;
        top: 8px
    }

    .pl__time {
        color: #a2a6a9;
        margin: 0;
        font-size: 13px;
        line-height: 15px
    }

    .pl__animated {
        -webkit-animation-duration: 1s;
        animation-duration: 1s;
        -webkit-animation-fill-mode: both;
        animation-fill-mode: both
    }

    @-webkit-keyframes pl__bounceInUp {
        from,
        60%,
        75%,
        90%,
        to {
            -webkit-animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1);
            animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1)
        }
        from {
            opacity: 0;
            -webkit-transform: translate3d(0, 3000px, 0);
            transform: translate3d(0, 3000px, 0)
        }
        60% {
            opacity: 1;
            -webkit-transform: translate3d(0, -20px, 0);
            transform: translate3d(0, -20px, 0)
        }
        75% {
            -webkit-transform: translate3d(0, 10px, 0);
            transform: translate3d(0, 10px, 0)
        }
        90% {
            -webkit-transform: translate3d(0, -5px, 0);
            transform: translate3d(0, -5px, 0)
        }
        to {
            -webkit-transform: translate3d(0, 0, 0);
            transform: translate3d(0, 0, 0)
        }
    }

    @keyframes pl__bounceInUp {
        from,
        60%,
        75%,
        90%,
        to {
            -webkit-animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1);
            animation-timing-function: cubic-bezier(0.215, 0.61, 0.355, 1)
        }
        from {
            opacity: 0;
            -webkit-transform: translate3d(0, 3000px, 0);
            transform: translate3d(0, 3000px, 0)
        }
        60% {
            opacity: 1;
            -webkit-transform: translate3d(0, -20px, 0);
            transform: translate3d(0, -20px, 0)
        }
        75% {
            -webkit-transform: translate3d(0, 10px, 0);
            transform: translate3d(0, 10px, 0)
        }
